import React, { Component } from 'react'
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';

import TextField from 'material-ui/TextField';
import RaisedButton from 'material-ui/RaisedButton'


const styles ={
  button:{
    margin:15
  }
}
class SignupForm extends Component {
    changeStep = e =>{

        this.props.prevStep();
    }
      render(){
        const {handleChange,values} = this.props;

        return (

          <MuiThemeProvider>
              <React.Fragment>
                  <br/>
                <RaisedButton 
                  label="Log-In"
                  primary = {true}  
                  style = {styles.button}
                  onClick={this.changeStep}

                   />
                   <RaisedButton 
                  label="Sign-Up"
                  primary = {false}  
                  style = {styles.button}

                   />
                   <br/>
                  <TextField  

                  hintText="Enter your firstname" floatingLabelText="First Name" 
                  onChange={handleChange('firstname')}
                  defaultValue={values.firstname}
                  />
                  <br/>
                  <TextField  
                  hintText="Enter your lastname" floatingLabelText="Last Name" 
                  onChange={handleChange('lastname')}
                  defaultValue={values.lastname}
                  />
                  <br/>
                  <TextField  
                  hintText="Enter your email" floatingLabelText="E-mail" 
                  type="email"
                  onChange={handleChange('email')}
                  defaultValue={values.email}
                  />
                  <br/>
                  <TextField
                    hintText="Password" floatingLabelText="Password"
                    type="password"
                    onChange={handleChange('password')}
                  />
                  <br/>
                  <TextField
                    hintText="Confirm password" floatingLabelText="Confirm-Password"
                    type="password"

                  />

                   <br/>
                  <RaisedButton 
                  label="Submit"
                  primary = {true}  
                  style = {styles.button}
                  onClick={this.props.nextStep}
                   />

                 </React.Fragment>
          </MuiThemeProvider>

      )

      }

}

export default SignupForm;
